const ListAllProducts = ({allProducts}) => {
   
  return (
    <div>
      
      <div className='container'>
            <h1>All Products :</h1>
            <div>
               { 
               allProducts.map((product,index) => (
                <div key={index}>
                    <link to ={`${product._id}`}>{product.title}</link>
                </div>
               ))}
            </div>
    </div>
    </div>
  )
}

export default ListAllProducts
